import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Home from './components/pages/Home';
import Contact from './components/pages/Contact';
import NewProject from './components/pages/NewProject';
import Company from './components/Company';
import Container from './components/layout/Container';

function App() {
  return (
    <Router>
      <div>
        <Link to="/">Home</Link>
        <Link to="/contact">Contato</Link>
        <Link to="/company">Empresa</Link>
        <Link to="/new-project">Novo Projeto</Link>
      </div>
      <Routes>
        <Container customClass= "min-height"/>
        <Route path="/" element={<Container><Home /></Container>} />
        <Route path="/contact" element={<Container><Contact /></Container>} />
        <Route path="/new-project" element={<Container><NewProject /></Container>} />
        <Route path="/company" element={<Container><Company /></Container>} />
      </Routes>
    </Router>
  );
}

export default App;
